import Sidebar from '../Sidebar';
import { Outlet } from 'react-router-dom';

const Layout = () =>{
    return (
        <div className='App'>
            <Sidebar />
            <div className='page'>
                <span className='tags top-pages'>
                    &lt;body&gt;
                    </span>

                <Outlet />

                <span className='tags bottom-pages'>
                &lt;body&gt;
                </span>
            </div>

        </div>
    )
        
    
}

export default Layout
